import React from "react";
import ReactDOM from "react-dom";
import cars from "../Practice";

const [honda, tesla] = cars;

const {speed: {top: teslaTopSpeed }, colour: [teslaTopColour]} = tesla;
const {speed: {zero: hondaTopSpeed }, colour: [hondaTopColour]} = honda;


function Destracting() {
    return (
        <div>
            <table>
             <tr>
               <th>Brand</th>
              <th>Top Speed</th>
           </tr>
            <tr>
               <td>{tesla.model}</td>
              <td>{teslaTopSpeed}</td>
           <td>{teslaTopColour}</td>
             </tr>
             <tr>
               <td>{honda.model}</td>
               <td>{hondaTopSpeed}</td>
               <td>{hondaTopColour}</td>
             </tr>
           </table>,
        </div>
      
    )
}

export default Destracting;
